import React, {Component} from 'react';
import YoutubeComp from '../../component/YoutubeComponent/YoutubeComp';

class Home extends Component{
    render(){
        return (
            <div>
                <p>Youtube Component</p>
                <br/>
                <YoutubeComp time = '7.12'/>
                <YoutubeComp/>
                <YoutubeComp/>
                <YoutubeComp/>
                <YoutubeComp/>
            </div>
        )
    }
}

export default Home;
